-extern void abort (void);
-
-union _D_rep
-{
-  unsigned short rep[4];
-  double val;
-};
-
-int add(double* key, double* table)
-{
-  unsigned i = 0;
-  double* deletedEntry = 0;
-  while (1) {
-    double* entry = table + i;
-
-    if (*entry == *key)
-      break;
-
-    union _D_rep _D_inf = {{ 0, 0, 0, 0x7ff0 }};
